import React, {Component} from 'react';

class Items extends Component{
    render(){
        const myItems = this.props.items.map((item) => {
            if(item.count > 1 ){
                return(
                    <div key={item.id}>
                        <div>{item.id}</div>
                        <div>{item.name}</div>
                        <div>{item.age}</div>
                        <div>_______</div>
                    </div>
                );
            }
        })
        return(
            <div>
                {myItems}
            </div>
        );
    }
}

export default Items;
